import CATEGORY_DATA from "../data/category";

let categoryList = CATEGORY_DATA;

export const getTop10LatestProducts = () => {
  console.log(categoryList);
  let listItems = [];
  categoryList.forEach(({ items }) => {
    Object.keys(items).forEach(
      (key) => (listItems = [...listItems, items[key].map((item) => item)])
    );
  });
  console.log(listItems);
};
